sys_variable_value.value:
(function execute(inputs, outputs) {
 if(inputs.status == 200){
    var reservationDetails=JSON.parse(inputs.responseBody);
    outputs.status = "Success";

    outputs.addressid = reservationDetails.address_id;
    outputs.scopegroupid = reservationDetails.scope_group_id;
    outputs.id = reservationDetails.id;
    outputs.options = JSON.stringify(reservationDetails.options);
    outputs.reservationresponse = JSON.parse(inputs.responseBody);

  } else {
    outputs.status= "Failure";
    outputs = new NSOneErrorHandler().dhcpErrorHandler(inputs, outputs);
  }

})(inputs, outputs);

